- uid: azure-servicefabric.ReplicatorQueueStatus.committedSequenceNumber
  name: committedSequenceNumber
  fullName: committedSequenceNumber
  children: []
  langs:
  - typeScript
  type: property
  summary: >-
    주 복제 자가, 이것이 의미 체계가 있는 보조 복제본의 쓰기 쿼럼 승인을 보낸 작업의 시퀀스 번호가 가장 높은.

    보조 복제자에서 이것이 의미 체계가 기본에서 받은 순서 대로 작업의 시퀀스 번호가 가장 높은입니다.
  optional: true
  syntax:
    content: 'committedSequenceNumber?: string'
    return:
      type:
      - string
  package: azure-servicefabric
